import React, { Component } from 'react'

export default class NeedLogin extends Component {
    login = () => {
        this.props.auth.login();
      }
      logout = () => {
        this.props.auth.logout();
      }
  render() {
    return (
      <div>
         <p>
                Please{' '}
                <a href
                  style={{ cursor: 'pointer' }}
                  onClick={this.login}
                >
                  Log In
                </a>
                {' '}to check it out more dashboard!
              </p>
      </div>
    )
  }
}
